import React, {Component} from 'react';
import img_background from './images/daytoner2.jpg';
import './Marketplace.css';


class Marketplace extends Component {
	constructor(props){
		super(props);
		this.state = {
		item: []
		}
	}

	componentDidlMount(){
		fetch('/api/item')
		.then(data => data.json())
		.then(lot => this.setState({lot}));
	}

	render(){
		return(
			<div>
		
				<h3> Marketplace </h3>
			</div>
		)
	}
}
export default Marketplace;
